import { Component } from "react";
import './FashionData.css';

class FashionData extends Component{
    render(){
        return(
            <div className='first-fash'>  
            <div className='fash-text'>
                <h2>{this.props.heading}</h2>
                <p>
                    {this.props.text}
                </p>
            </div>
            <div className='fash-img'>
                <img src='https://www.borsheims.com/blog/wp-content/uploads/2022/05/breitling-navitimer-watch.webp' alt='watches'/>
                <img src='https://images.unsplash.com/photo-1548171916-c0dea7f94ca6?q=80&w=1460&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt='watches'/>
            </div>
        </div>
        )
    }
}

export default FashionData
